def f_gold(n: int, reservedSeats: List[List[int]]) -> int:
    m = defaultdict(int)
    for i, j in reservedSeats:
        m[i] = m[i] | (1 << (10 - j))
    masks = (0b0111100000, 0b0000011110, 0b0001111000)
    ans = (n - len(m)) << 1
